原题链接
思路
递归法，判断二叉树是否为镜像对称。
镜像特点：

根节点：左节点值 = 右节点值
非根节点：左节点值 = 兄弟节点的右节点值

因此，可对每两个镜像节点做如下判断：
if 节点A为空:
    if 节点B为空:
        return 是镜像
    else:
        return 不是镜像
else:
    if 节点B为空:
        return 不是镜像
    else:
        if 节点A值 == 节点B值:
            return 是镜像
        else:
            return 不是镜像
对接下来的节点进行递归：

A节点的左节点与B节点的右节点
A节点的右节点与B节点的左节点

